  1→'use client';
  2→
  3→import { useState } from 'react';
  4→import Image from 'next/image';
  5→import { motion } from 'framer-motion';
  6→import { FiHeart } from 'react-icons/fi';
  7→import Lightbox from 'yet-another-react-lightbox';
  8→import 'yet-another-react-lightbox/styles.css';
  9→import PhotoGallery, { GalleryPhoto } from './PhotoGallery';
 10→
 11→interface GallerySectionProps {
 12→  id: string;
 13→  title: string;
 14→  subtitle?: string;
 15→  emoji?: string;
 16→  photos: GalleryPhoto[];
 17→  columns?: 2 | 3 | 4;
 18→  bg?: 'white' | 'cream';
 19→}
 20→
 21→export default function GallerySection({
 22→  id,
 23→  title,
 24→  subtitle,
 25→  emoji = '📷',
 26→  photos,
 27→  columns = 3,
 28→  bg = 'cream',
 29→}: GallerySectionProps) {
 30→  const [lightboxIndex, setLightboxIndex] = useState(-1);
 31→
 32→  const bgClass =
 33→    bg === 'white'
 34→      ? 'bg-white dark:bg-[#1f1118]'
 35→      : 'bg-ivory dark:bg-[#1a0f14]';
 36→
 37→  const heroPhoto = photos[0];
 38→  const gridPhotos = photos.slice(1);
 39→
 40→  return (
 41→    <section id={id} className={`py-28 md:py-32 px-6 ${bgClass}`}>
 42→      <div className="max-w-6xl mx-auto">
 43→        {/* Section header */}
 44→        <motion.div
 45→          initial={{ opacity: 0, y: 30 }}
 46→          whileInView={{ opacity: 1, y: 0 }}
 47→          viewport={{ once: true }}
 48→          transition={{ duration: 0.7, ease: [0.25, 0.1, 0.25, 1.0] }}
 49→          className="text-center mb-16 md:mb-20"
 50→        >
 51→          <div className="flex items-center justify-center gap-4 mb-5">
 52→            <div className="h-px w-12 bg-blush-200 dark:bg-blush-800" />
 53→            <FiHeart className="text-blush-400" size={14} />
 54→            <div className="h-px w-12 bg-blush-200 dark:bg-blush-800" />
 55→          </div>
 56→          <span className="text-4xl block mb-4">{emoji}</span>
 57→          <h2 className="font-script text-5xl md:text-6xl text-blush-700 dark:text-blush-300 mb-3">
 58→            {title}
 59→          </h2>
 60→          {subtitle && (
 61→            <p className="font-serif text-lg md:text-xl text-[#2d1a24]/55 dark:text-blush-200/55 max-w-2xl mx-auto leading-relaxed">
 62→              {subtitle}
 63→            </p>
 64→          )}
 65→        </motion.div>
 66→
 67→        {/* Featured hero photo — full width cinematic crop */}
 68→        {heroPhoto && (
 69→          <motion.div
 70→            initial={{ opacity: 0, y: 20 }}
 71→            whileInView={{ opacity: 1, y: 0 }}
 72→            viewport={{ once: true }}
 73→            transition={{ duration: 0.7, ease: [0.25, 0.1, 0.25, 1.0] }}
 74→            className="relative w-full aspect-[4/3] sm:aspect-[16/9] md:aspect-[21/9] overflow-hidden rounded-2xl mb-8 cursor-pointer group"
 75→            onClick={() => setLightboxIndex(0)}
 76→          >
 77→            <Image
 78→              src={heroPhoto.src}
 79→              alt={heroPhoto.alt}
 80→              fill
 81→              className="object-cover object-top md:object-[center_30%] transition-transform duration-700 group-hover:scale-[1.02]"
 82→              sizes="100vw"
 83→            />
 84→            <div className="absolute inset-0 bg-gradient-to-t from-black/30 via-transparent to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300" />
 85→          </motion.div>
 86→        )}
 87→
 88→        {/* Masonry gallery grid — remaining photos */}
 89→        <PhotoGallery
 90→          photos={gridPhotos}
 91→          columns={columns}
 92→          lightboxPhotos={photos}
 93→          lightboxOffset={1}
 94→        />
 95→      </div>
 96→
 97→      {/* Lightbox for hero photo click */}
 98→      <Lightbox
 99→        open={lightboxIndex >= 0}
100→        index={lightboxIndex}
101→        close={() => setLightboxIndex(-1)}
102→        slides={photos.map((p) => ({ src: p.src, alt: p.alt }))}
103→      />
104→    </section>
105→  );
106→}
