 1→'use client';
 2→
 3→import { useState } from 'react';
 4→import Image from 'next/image';
 5→import { motion } from 'framer-motion';
 6→import { FiMaximize2 } from 'react-icons/fi';
 7→import Lightbox from 'yet-another-react-lightbox';
 8→import 'yet-another-react-lightbox/styles.css';
 9→
10→export interface GalleryPhoto {
11→  src: string;
12→  alt: string;
13→  width?: number;
14→  height?: number;
15→  caption?: string;
16→}
17→
18→interface PhotoGalleryProps {
19→  photos: GalleryPhoto[];
20→  columns?: 2 | 3 | 4;
21→  /** Full photo array for lightbox (when hero photo is extracted) */
22→  lightboxPhotos?: GalleryPhoto[];
23→  /** Offset to add to grid index for lightbox (when hero is index 0) */
24→  lightboxOffset?: number;
25→}
26→
27→export default function PhotoGallery({
28→  photos,
29→  columns = 3,
30→  lightboxPhotos,
31→  lightboxOffset = 0,
32→}: PhotoGalleryProps) {
33→  const [lightboxIndex, setLightboxIndex] = useState(-1);
34→
35→  const allPhotos = lightboxPhotos || photos;
36→
37→  if (photos.length === 0) {
38→    return (
39→      <div className="text-center py-20">
40→        <p className="text-4xl mb-4">&#128247;</p>
41→        <p className="font-serif text-lg text-[#2d1a24]/50 dark:text-blush-200/50">
42→          Photos coming soon...
43→        </p>
44→      </div>
45→    );
46→  }
47→
48→  const colClasses = {
49→    2: 'columns-1 sm:columns-2',
50→    3: 'columns-1 sm:columns-2 lg:columns-3',
51→    4: 'columns-1 sm:columns-2 lg:columns-3 xl:columns-4',
52→  }[columns];
53→
54→  return (
55→    <>
56→      <div className={`${colClasses} gap-4`}>
57→        {photos.map((photo, idx) => (
58→          <motion.div
59→            key={photo.src}
60→            initial={{ opacity: 0, y: 24 }}
61→            whileInView={{ opacity: 1, y: 0 }}
62→            whileHover={{ y: -4 }}
63→            viewport={{ once: true, margin: '-40px' }}
64→            transition={{ duration: 0.5, delay: (idx % 6) * 0.07, ease: [0.25, 0.1, 0.25, 1.0] }}
65→            className="break-inside-avoid mb-4 group relative overflow-hidden rounded-2xl cursor-pointer bg-blush-50 dark:bg-[#2d1020] border border-blush-100 dark:border-blush-900/30 shadow-soft hover:shadow-glow transition-shadow duration-300"
66→            onClick={() => setLightboxIndex(idx + lightboxOffset)}
67→          >
68→            <Image
69→              src={photo.src}
70→              alt={photo.alt}
71→              width={800}
72→              height={600}
73→              className="w-full h-auto object-cover transition-transform duration-500 group-hover:scale-[1.03]"
74→              sizes="(max-width: 640px) 100vw, (max-width: 1024px) 50vw, 33vw"
75→            />
76→            {/* Hover overlay */}
77→            <div className="absolute inset-0 bg-gradient-to-t from-[#2d1a24]/40 via-transparent to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300 flex items-end justify-end p-4">
78→              <FiMaximize2 className="text-white/70 flex-shrink-0" size={14} />
79→            </div>
80→          </motion.div>
81→        ))}
82→      </div>
83→
84→      {/* Lightbox */}
85→      <Lightbox
86→        open={lightboxIndex >= 0}
87→        index={lightboxIndex}
88→        close={() => setLightboxIndex(-1)}
89→        slides={allPhotos.map((p) => ({ src: p.src, alt: p.alt }))}
90→      />
91→    </>
92→  );
93→}
