  1→#!/usr/bin/env node
  2→
  3→/**
  4→ * generate-gallery.mjs
  5→ *
  6→ * Scans photo folders under public/images/ and generates utils/galleryData.ts.
  7→ *
  8→ * HOW IT WORKS:
  9→ *   1. Each section folder (blessings, couple, signing, family, portraits, feast)
 10→ *      is scanned for image files (.jpg, .jpeg, .png, .webp).
 11→ *   2. If a _captions.json exists in the folder, it provides alt text, captions,
 12→ *      and — crucially — the display order. Photos listed in _captions.json appear
 13→ *      first, in that order. Any new photos not in _captions.json are appended
 14→ *      alphabetically at the end.
 15→ *   3. Photos without a _captions.json entry get a generic alt derived from the
 16→ *      folder name and filename.
 17→ *
 18→ * FOR CONTRIBUTORS:
 19→ *   - To ADD a photo:    Drop it into the right folder (e.g. public/images/blessings/).
 20→ *   - To REMOVE a photo: Delete the file from the folder.
 21→ *   - To set alt/caption: Edit _captions.json in that folder (optional).
 22→ *   - The build step runs this script automatically before every build/dev.
 23→ */
 24→
 25→import { readdirSync, readFileSync, writeFileSync, existsSync } from 'node:fs';
 26→import { join, extname, basename, resolve, dirname } from 'node:path';
 27→import { fileURLToPath } from 'node:url';
 28→
 29→const __dirname = dirname(fileURLToPath(import.meta.url));
 30→const ROOT = resolve(__dirname, '..');
 31→const IMAGES_DIR = join(ROOT, 'public', 'images');
 32→const OUTPUT = join(ROOT, 'utils', 'galleryData.ts');
 33→
 34→const IMAGE_EXTS = new Set(['.jpg', '.jpeg', '.png', '.webp']);
 35→
 36→// Section config: folder name → export name, display order matches page layout
 37→const SECTIONS = [
 38→  { folder: 'pre-wedding', exportName: 'preWeddingGalleryPhotos' },
 39→  { folder: 'blessings', exportName: 'blessingPhotos' },
 40→  { folder: 'couple', exportName: 'couplePhotos' },
 41→  { folder: 'signing', exportName: 'signingPhotos' },
 42→  { folder: 'family', exportName: 'familyPhotos' },
 43→  { folder: 'portraits', exportName: 'portraitSectionPhotos' },
 44→  { folder: 'feast', exportName: 'feastPhotos' },
 45→];
 46→
 47→function getImageFiles(folderPath) {
 48→  if (!existsSync(folderPath)) return [];
 49→  return readdirSync(folderPath).filter(
 50→    (f) => IMAGE_EXTS.has(extname(f).toLowerCase()) && !f.startsWith('_')
 51→  );
 52→}
 53→
 54→function loadCaptions(folderPath) {
 55→  const captionsPath = join(folderPath, '_captions.json');
 56→  if (!existsSync(captionsPath)) return null;
 57→  try {
 58→    return JSON.parse(readFileSync(captionsPath, 'utf-8'));
 59→  } catch (e) {
 60→    console.warn(`Warning: Failed to parse ${captionsPath}: ${e.message}`);
 61→    return null;
 62→  }
 63→}
 64→
 65→function humanize(folder) {
 66→  return folder.charAt(0).toUpperCase() + folder.slice(1).replace(/-/g, ' ');
 67→}
 68→
 69→function escapeTS(str) {
 70→  return str.replace(/\\/g, '\\\\').replace(/'/g, "\\'");
 71→}
 72→
 73→function buildPhotoArray(folder) {
 74→  const folderPath = join(IMAGES_DIR, folder);
 75→  const allFiles = getImageFiles(folderPath);
